e you carry the blood of their namesake&#8212;the mightiest of Chinese supernatural creatures, the dragon. Knowing, imperious, confident, you stride through humanity&#8217;s ranks mantled in good fortune. Driven by your melodramatic hook, you&#8217;re willing to risk all you&#8217;ve achieved and accumulated for victory in the chi war.", "Hair Color": "", "Style of Dress": "", "Melodramatic Hook": null}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0, "Police": 0, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 0, "Intrusion": 0, "Seduction": 0, "Leadership": 0, "Constituion": 0, "Intimidation": 0, "Backup Attack: Guns": 12}	\N	\N	\N	\N	\N	\N	\N	\N	\N	[]
