atic Hook": null}	{"Will": 0, "Deceit": 10, "Fix-It": 0, "Notice": 0, "Police": 0, "Driving": 11, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 0, "Intrusion": 11, "Seduction": 0, "Leadership": 0, "Constituion": 0, "Intimidation": 0, "Info: Kid Culture": 15}	\N	\N	\N	\N	\N	\N	\N	\N	\N	[]
