Penelope Andrews	\N	0	2023-06-08 00:02:08.896672	2025-07-22 00:59:53.799798	#f8e71c	ddf30a26-fa16-4ed1-8f1c-a285f7fe682e	{"Guns": 14, "Type": "PC", "Speed": 6, "Damage": 0, "Genome": 0, "Mutant": 0, "Wounds": 0, "Defense": 14, "Fortune": 8, "Sorcery": 13, "Creature": 0, "Archetype": "Magic Cop", "Toughness": 8, "MainAttack": "Guns", "FortuneType": "Magic", "Max Fortune": 8, "Martial Arts": 0, "Scroungetech": 0, "Marks of Death": 0, "SecondaryAttack": "Sorcery"}	5a158850-6074-4e56-b8eb-929fedd47099	0f2b51c0-80c0-4f5f-b55f-76186903df3e	t	{"Age": "29", "Height": "5'9\\"", "Weight": "162", "Eye Color": "Green", "Nicknames": "Pen", "Appearance": "Of average height and athletic build, busty, pretty but not striking. Keeps her hair in a ponytail most of the time. As a necklace with a gold ring in a 'braided' pattern, a matching on her left hand. ", "Background": "Texas Ranger (Sergeant, Company D) from the deep south in Texas. Became a ranger after her fiance (Bobby Granger, local deputy) was killed by fleeing Mexican drug runners (who turned out to be Ascended) as they cut through her hometown of Sawdale. Has a good shot, a keen mind, and a knack for taking charge.", "Hair Color": "Sandy Blond", "Style of Dress": "Plain Clothes Cop", "Melodramatic Hook": "<p>A magical storm caused by the war in the nether slipped out of a portal and obliterated her hometown of Sawdale. While visiting the ruins in the hopes of finding any belongings from what was her home, she ended up following her father's ghost to the portal. Minutes after stepping through, it snapped shut as the Chi Machine went off in the future, shifting the junctures. She now hopes to fix the juncture portals to get home... if she still has one... And along the way, hopes to put an end to the chi war, or at least stop the open hostilities that are causing innocent bystanders to suffer. Kinda wants to find <a href=\\"/factions/0efadcdd-58c6-4844-91a7-2a0527b305a2\\" class=\\"mention\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\" data-mention-id=\\"0efadcdd-58c6-4844-91a7-2a0527b305a2\\" data-mention-class-name=\\"Faction\\">@The Ascended</a> in charge of the drug runners, too. Having traveled with the Dragons for some time now, Penny has come to the conclusion that she cannot put an end to the chi war. However, she wants to aid their goals and help the Dragons to claim the modern juncture, or at least to loosen the grip the Ascended have upon it. After the loss of <a href=\\"/characters/8b484001-0278-4af1-9dd6-137d0ed12c7d\\" class=\\"mention\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\" data-mention-id=\\"8b484001-0278-4af1-9dd6-137d0ed12c7d\\" data-mention-class-name=\\"Character\\">@Serena Tessaro</a>, she wants to create the magical tome to replace the one lost to honor her friend and fellow mage, the Tessaro Infernum. To that end... she has no idea where to start yet. But she knows she'll need magical artifacts, and maybe more power. Helping to solve this issue with Manly International may lead her to that conclusion.</p>"}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0, "Police": 12, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 0, "Intrusion": 0, "Seduction": 0, "Leadership": 0, "Constituion": 0, "Info: Occult": 13, "Intimidation": 0}	830d358c-789e-4e98-b511-753a0aa8d410	https://ik.imagekit.io/nvqgwnjgv/chi-war-production/penelope_98vBXG35q.png	\N	c9d8393d-011a-4ac6-b436-c35cf14f3f4a	\N	\N	5c7d5473-9d5a-4539-b38a-39bd1a2393e4	Working Stiff	\N	[]
