"Scorch" O'Connor	\N	\N	2024-03-14 01:20:55.91595	2025-07-20 12:51:39.95046		dd8dd378-deab-44c0-b361-a8840f39bc30	{"Guns": 16, "Type": "Ally", "Speed": 6, "Damage": 12, "Genome": 0, "Mutant": 0, "Wounds": 0, "Defense": 14, "Fortune": 0, "Sorcery": 0, "Creature": 0, "Archetype": null, "Toughness": 7, "MainAttack": "Guns", "FortuneType": "Fortune", "Max Fortune": 0, "Martial Arts": 15, "Scroungetech": 0, "Marks of Death": 0, "SecondaryAttack": "Martial Arts"}	7a9b1cdc-17cb-42fd-ad30-098891365e61	0f2b51c0-80c0-4f5f-b55f-76186903df3e	t	{"Age": "37", "Height": "6’2”", "Weight": "237 lbs", "Eye Color": "blue", "Nicknames": "", "Appearance": "<p>Charismatic leader and visionary of the Runnerpunks.</p>", "Background": "<h2>The Charismatic Visionary</h2><p>Scorch O'Connor stands tall as the charismatic leader of the Runnerpunks , a rebel faction operating in the shadowy underbelly of the Cyberpunk Future . With an imposing presence and natural authority, he commands respect from both allies and enemies. His leadership skills are complemented by his exceptional combat abilities, making him a formidable figure in both strategy and battle.</p><p>During the mission to extract Doctor Cyborg from Manlysaka, Scorch demonstrated his tactical acumen by coordinating the escape efforts of his team. Even when faced with overwhelming odds against Captain Vic Reynolds and his cyber troopers, Scorch maintained his composure, taking precise shots with his rifle that staggered the enemy commander.</p><h2>Cybernetic Enhancements</h2><p>Like many in the cyberpunk future, Scorch has embraced technological augmentation. He possesses optical implants that enhance his targeting capabilities, though these same implants proved to be a vulnerability when the enemy hacker, Sophia Chen, managed to temporarily blind him by hacking into his visual systems. Despite this setback, he adapted quickly, using his other senses to continue fighting and leading.</p><p>When his vision was compromised during the escape, Scorch didn't panic. Instead, he relied on his hearing to follow Titania Manly's voice to safety, showing his ability to overcome technological vulnerabilities through sheer determination and adaptability.</p><h2>Arsenal and Combat Style</h2><p>Scorch favors firearms in combat, wielding his rifle with deadly precision. His Guns skill (16) surpasses even his considerable Martial Arts ability (15), making him a lethal marksman. When his primary weapon jammed during the escape, he seamlessly transitioned to a handgun, showing his versatility in armed combat.</p><p>His tactical approach extends beyond personal combat—Scorch commands a pack of robotic dogs that serve as both companions and weapons, unleashing them against enemies with simple verbal commands.</p><h2>Leadership and Loyalty</h2><p>As leader of the Runnerpunks, Scorch's primary concern is for his people. He guides them through dangerous missions, makes crucial strategic decisions, and mourns deeply when they fall. The deaths of Hiro Lee and Luis Ortega during the Manly-Saka extraction mission affected him profoundly, leading him to raise a toast to their memory at the safehouse afterward.</p><p>His practical nature is evident in his approach to the hostage situation with Doctor Cyborg , viewing the scientist primarily as leverage to secure the release of captured Runnerpunks members from the New York penal colony. Yet he balances this pragmatism with genuine care for his followers, earning their unwavering loyalty in return.</p><p>Scorch embodies the rebellious spirit of the Runnerpunks, fighting against corporate tyranny while maintaining a code of honor that places the welfare of his people above all else. In a world dominated by entities like Manly-Saka, he represents the resilience of the human spirit against overwhelming technological oppression.</p>", "Hair Color": "brown", "Style of Dress": "No-nonsense, field commander", "Melodramatic Hook": ""}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0