ir Color": "", "Style of Dress": "", "Melodramatic Hook": null}	{"Will": 0, "Deceit": 12, "Fix-It": 11, "Notice": 0, "Police": 0, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 0, "Intrusion": 15, "Seduction": 0, "Leadership": 0, "Constituion": 0, "Intimidation": 0, "Info: Architecture": 15}	\N	\N	\N	\N	\N	\N	\N	Working Stiff	t	[]
