ic Hook": null}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0, "Police": 0, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 0, "Intrusion": 0, "Seduction": 0, "Leadership": 11, "Constituion": 0, "Intimidation": 0, "Info: Calligraphy": 15, "Info: Chinese Philosophy": 15}	\N	\N	\N	\N	\N	\N	\N	Working Stiff	t	[]
