nd from, a truculent crab spirit, ferce and determined to protect itself and its loved ones from the many harms of a hostile world. Some threat has lured you reluctantly from the safety of your carefully constructed life. Whoever steps on you will live to regret it.", "Hair Color": "", "Style of Dress": "", "Melodramatic Hook": ""}	{"Will": 0, "Deceit": 0, "Fix-It": 11, "Notice": 0, "Police": 0, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 0, "Intrusion": 0, "Seduction": 0, "Intimidate": 13, "Leadership": 0, "Constituion": 0, "Intimidation": 0, "Backup Attack: Guns": 10}	\N	\N	\N	\N	\N	\N	\N	\N	\N	[]
