Ghost	\N	\N	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	\N	\N	{"Guns": 0, "Type": "PC", "Speed": 7, "Damage": 0, "Genome": 0, "Mutant": 0, "Wounds": 0, "Defense": 12, "Fortune": 8, "Sorcery": 13, "Creature": 0, "Archetype": "Ghost", "Toughness": 6, "MainAttack": "Sorcery", "FortuneType": "Magic", "Max Fortune": 8, "Martial Arts": 0, "Scroungetech": 0, "Marks of Death": 0, "SecondaryAttack": null}	317a298c-a051-46f2-9eb4-1833503fbcf6	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t	{"Age": "", "Height": "", "Weight": "", "Eye Color": "", "Nicknames": "", "Appearance": "", "Background": "Ghosts aplenty haunt the magic-rich ancient juncture. You are one of these&#8212;a spirit unwilling or unable to leave the trappings of mortal life behind to join the eternal cycle of reincarnation. The Netherworld is also home to many ghosts, former chi warriors whose life forces were too strong to depart the Inner Kingdom when their physical bodies died. Other ghosts prey on mortals, motivated either by jealousy of the living or by the same malign intentions they harbored in life. But you are tied to the Earth for some other reason. Your soul cannot rest, for in life you swore a solemn oath to complete some great undertaking. This crucial unfnished business probably comprises your melodramatic hook. You may have sworn to protect someone, to wreak vengeance on an enemy, or to recover some lost treasure or artifact. Ghosts have a bad habit of falling in love with mortals, and can often be stunningly beautiful and alluring. Although you know such loves are forbidden, you may already fnd yourself in a romantic entanglement that crosses the sacred barrier between the living and the dead. If you are not in such a doomed relationship, you are suffciently prone to such temptations that you might end up in one before the series is out.", "Hair Color": "", "Style of Dress": "", "Melodramatic Hook": null}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0, "Police": 0, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 0, "Intrusion": 0, "Seduction": 13, "Leadership": 0, "Constituion": 0, "Intimidation": 0, "Info: Musicianship": 13}	\N	\N	\N	\N	\N	\N	\N	\N	\N	[]
Private Investigator	\N	\N	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	\N	\N	{"Guns": 13, "Type": "PC", "Speed": 7, "Damage": 0, "Genome": 0, "Mutant": 0, "Wounds": 0, "Defense": 13, "Fortune": 6, "Sorcery": 0, "Creature": 0, "Archetype": "Private Investigator", "Toughness": 7, "MainAttack": "Guns", "FortuneType": "Fortune", "Max Fortune": 6, "Martial Arts": 0, "Scroungetech": 0, "Marks of Death": 0, "SecondaryAttack": null}	d9ad1bc8-db91-43ba-8371-fe883ab72aa3	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t	{"Age": "", "Height": "", "Weight": "", "Eye Color": "", "Nicknames": "", "Appearance": "", "Background": "As an experienced investigator you have accumulated contacts throughout society: from well-heeled clients who can afford to hire you, to the enforcers of the law you must occasionally skirt, to the seediest elements of the underworld. You most often work for lawyers, digging up information for use in court cases. When one corporation sues another, you find yourself poring over corporate ledgers and sifting for obscure references in old business publications. You&#8217;ve worked for insurance companies, keeping plaintiffs under surveillance to see if they&#8217;re as injured as they claim to be. And then of course there are divorce cases. Although you may have gotten into your line of work because you fell in love with the film noir world of Philip Marlowe and Sam Spade, you&#8217;ve spent more time hunched over a laptop performing background checks than you have slugging it out with gangsters and crooked cops. Maybe that&#8217;s why, when you sniff out the first clues that point you to the existence of the chi war, you&#8217;re ready to chuck the real-life world of the private detective in favor of the fantastic adventure you&#8217;ve always dreamed of.", "Hair Color": "", "Style of Dress": "", "Melodramatic Hook": null}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0, "Police": 0, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 15, "Info: Law": 11, "Intrusion": 11, "Seduction": 0, "Leadership": 0, "Constituion": 0, "Intimidation": 0, "Info: Business": 14, "Backup Attack: Martial Arts": 12}	\N	\N	\N	\N	\N	\N	\N	\N	\N	[]
Ex-Special Forces	\N	\N	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	\N	\N	{"Guns": 14, "Type": "PC", "Speed": 7, "Damage": 0, "Genome": 0, "Mutant": 0, "Wounds": 0, "Defense": 14, "Fortune": 7, "Sorcery": 0, "Creature": 0, "Archetype": "Ex-Special Forces", "Toughness": 7, "MainAttack": "Guns", "FortuneType": "Fortune", "Max Fortune": 7, "Martial Arts": 0, "Scroungetech": 0, "Marks of Death": 0, "SecondaryAttack": null}	d02c57aa-9e16-4aa7-9217-c161cea860d0	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t	{"Age": "", "Height": "", "Weight": "", "Eye Color": "", "Nicknames": "", "Appearance": "", "Background": "Afghanistan. Iraq. Places you still aren&#8217;t allowed to name. A former member of an elite force trained in counter-terrorism, hostage rescue, and sabotage missions, you had a hard-bitten military mindset drilled into you along with your extensive list of deadly skills. It is possible that you were dishonorably discharged from your beloved unit, fairly or otherwise; this might be your melodramatic hook. People keep expecting you to relax, to kick back, to get along, just like everybody else. But you can&#8217;t. Your nerves are still on edge. Whenever you get into a fender bender, or a confrontation on the street, it takes all of your determination not to leap on the guy harassing you and beat him to a pulp. You long for a new cause to believe in, one you can feel as much fervor for as your old corps. Most of all, you want the pure rush you get from combat. There&#8217;s nothing you&#8217;d like more than to feel the taste of blood and fear in your mouth on another battlefeld. If that battlefeld involves a fight for justice and freedom against tyrants from across the timestream, so much the better.", "Hair Color": "", "Style of Dress": "", "Melodramatic Hook": null}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0, "Police": 0, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 12, "Strength": 0, "Detective": 0, "Intrusion": 11, "Seduction": 0, "Leadership": 0, "Constituion": 0, "Intimidation": 0, "Info: Anti-Terrorism": 15, "Backup Attack: Martial Arts": 13}	\N	\N	\N	\N	\N	\N	\N	\N	\N	[]
Magic Cop	\N	\N	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	\N	\N	{"Guns": 14, "Type": "PC", "Speed": 6, "Damage": 0, "Genome": 0, "Mutant": 0, "Wounds": 0, "Defense": 13, "Fortune": 8, "Sorcery": 0, "Creature": 0, "Archetype": "Magic Cop", "Toughness": 7, "MainAttack": "Guns", "FortuneType": "Magic", "Max Fortune": 8, "Martial Arts": 0, "Scroungetech": 0, "Marks of Death": 0, "SecondaryAttack": null}	cfde27ab-7dfd-4f38-98ee-2eccc631be14	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t	{"Age": "", "Height": "", "Weight": "", "Eye Color": "", "Nicknames": "", "Appearance": "", "Background": "Even in junctures where magic is rare and difficult to perform, supernatural manifestations still ooze from the world&#8217;s dark corners, with sometimes lethal results. Many large police jurisdictions secretly maintain small units of officers trained in the mystic arts. These cops are able to take on the occasional renegade sorcerer or shaman who might pop up, and can dispatch demons and ghosts without freaking out. You are one of these cops. You&#8217;re probably a loner; the system is set up so you have little contact with regular law enforcement officials. Other officers think you&#8217;re nuts, if they know who you are at all. You have built up tough mental defenses against the creatures of the night. To normal folks, you come off as grim or aloof. You might think of yourself as a holy warrior, implacably gunning down anything that smacks of the occult. Or maybe you wish you could build a bridge between the world of the supernatural and the world of everyday humanity. Magic cops are often drawn into the chi war as they hunt down agents of the Lotus or escapees from the Netherworld, discovering that there is much hidden beneath reality&#8217;s mundane veneer that even they know nothing about.", "Hair Color": "", "Style of Dress": "", "Melodramatic Hook": null}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0, "Police": 12, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 0, "Intrusion": 0, "Seduction": 0, "Leadership": 0, "Constituion": 0, "Info: Occult": 13, "Intimidation": 0, "Back-Up Attack: Sorcery": 13}	\N	\N	\N	\N	\N	\N	\N	\N	\N	[]
