Two-Fisted Archaeologist	\N	\N	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	\N	\N	{"Guns": 0, "Type": "PC", "Speed": 6, "Damage": 0, "Genome": 0, "Mutant": 0, "Wounds": 0, "Defense": 13, "Fortune": 8, "Sorcery": 0, "Creature": 0, "Archetype": "Two-Fisted Archaeologist", "Toughness": 7, "MainAttack": "Martial Arts", "FortuneType": "Fortune", "Max Fortune": 8, "Martial Arts": 13, "Scroungetech": 0, "Marks of Death": 0, "SecondaryAttack": null}	2c2efc13-84ce-45d5-9549-b5b058b2ebe0	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t	{"Age": "", "Height": "", "Weight": "", "Eye Color": "", "Nicknames": "", "Appearance": "", "Background": "The past is dangerous. Your years as a field historian have proved that time and time again. Magic isn&#8217;t mere myth&#8212;it used to be stronger, and pockets of its power reside in the iconic treasures your museum trustees back home most want you to find and bring back for their display cases. Through bitter experience you&#8217;ve learned that some of these are best stored in secure facilities, where the chaos they&#8217;d unleash cannot threaten humanity.\\r\\rBy seeking these items you&#8217;ve nosed your way into a covert battle waged with history as its prize, and knowledge of that history a key weapon. Your rivals have ranged from unscrupulous profiteers to hallucinogen-snorting cultists to reactionary terrorist groups. The archaeological sites you&#8217;ve dedicated your professional life to resonate with mystical energies, making them strategic prizes in that fight. To protect both innocent lives and the precious heritage of these sites, you&#8217;re about to join the chi war.", "Hair Color": "", "Style of Dress": "", "Melodramatic Hook": null}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0, "Police": 0, "Driving": 0, "Gambling": 0, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 11, "Intrusion": 0, "Seduction": 0, "Leadership": 0, "Constituion": 0, "Intimidation": 0, "Info: History": 15, "Backup Attack: Guns": 12}