Marcus Herculeus Satanus	\N	0	2025-07-20 18:11:01.798412	2025-09-18 01:35:50.562001		ddf30a26-fa16-4ed1-8f1c-a285f7fe682e	{"Guns": 0, "Type": "PC", "Speed": 9, "Damage": 0, "Genome": 0, "Mutant": 0, "Wounds": 3, "Defense": 14, "Fortune": 6, "Sorcery": 0, "Creature": 0, "Archetype": "Sword Master", "Toughness": 6, "MainAttack": "Martial Arts", "FortuneType": "Chi", "Max Fortune": 6, "Martial Arts": 14, "Scroungetech": 0, "Marks of Death": 0, "SecondaryAttack": null}	080a92ba-3e60-423f-98f9-1f2589fe0cf6	0f2b51c0-80c0-4f5f-b55f-76186903df3e	t	{"Age": "40", "Height": "5'10\\"", "Weight": "195 lbs", "Eye Color": "Blue", "Nicknames": "Mark, Hercule, Herc, Ponti (only by those that knew him before)", "Appearance": "A braggart of a man who often boasts of his own greatness, but does not truly love combat. Except when he does, as the cursed blade he carries drives him to bloodlust when drawn. His boastful nature is to hide his deep shame.Tall, well muscled, but slightly overweight. He stands out among the Chinese men he escorts. Does not wear his Centurion armor, but carries it with him.\\nSpeaks Chinese VERY badly. Wealth: Poor", "Background": "<p>Former Roman Centurion, originally named Sextus Pontifus Gloriator. Born in and lived in Constantinople, where his family still lives. He and his legionnaires were dispatched to search a tomb ruins found in Anatolia (modern day Turkey). However, they were found and attacked by a an unknown group (Eaters of the Lotus), who used magic to destroy most in combat. Taking refuge in the tomb, Sextus found a sword sitting upon an altar. Upon picking it up, a bloodlust overcame him, and he blacked out. He awoke to find he had slaughtered not only the attackers, but his own men.<br><br>In shame, he exiled himself, changing his name to Marcus Herculeus Satanus. He found evidence on the dead attackers they were from the east, and so headed into China to track them down, hoping to find the reason for the sword's curse, why they attacked him, and a way to free himself from the curse. He now spends his time as a caravan guard, hoping to learn what he can from merchants as he travels. All he knows is the name Eaters of the Lotus, and little more.</p><p>His wife (Aurelia) died shortly after the birth of their daughter (Videlea, 18).<br>Heard word he now has a son-in-law (Oryzan, 18) before being dispatched, but has not met the man.</p><p>Name meaning<br>Sextus / Marcus: Common roman first names<br>Pontifus: Pontificate, talks a lot<br>Gloriator: braggart<br>Herculeus: Hercules (duh), as he thinks he is still strong<br>Satanus: Adversary, picked as he fights against himself and the curse<br>Videlae: Videl (Hercule's daughter in DBZ)<br>Oryzan: Latin for Rice (Gohan means \\"cooked rice\\" in Japanese)</p>", "Hair Color": "Black", "Style of Dress": "Ancient Soldier / Commoner", "Melodramatic Hook": "Attacked by a group he learned was the Eaters of the Lotus, who were after the sword he found and picked up.\\nThe sword is cursed, driving the wielder to bloodlust.\\nHe hopes to someday find the origin of the curse, and to break the curse, not just upon himself, but upon the sword.\\nHe refuses to let any carry it, or touch it, for fear the curse will afflict them.\\nHopes to someday redeem himself for his crime of killing his own men. Until that day, he will not return home to Constantinople, or his family."}	{"Will": 0, "Deceit": 0, "Fix-It": 0, "Notice": 0, "Police": 0, "Driving": 0, "Gambling": 11, "Medicine": 0, "Sabotage": 0, "Strength": 0, "Detective": 0, "Intrusion": 13, "Seduction": 0, "Leadership": 0, "Constituion": 0, "Intimidation": 0, "Info: Smithing & Metallurgy": 14}	830d358c-789e-4e98-b511-753a0aa8d410	\N	f	236e0b55-d417-80e7-9cb4-d800d6a9b7d8	2025-07-20 19:13:38.198557	\N	e0c8def0-a590-490d-81d7-401d697ac8d7	Poor	\N	[]
