d9bc6c2f-ebe1-4300-a836-dcb36e6454ab	Thunder Pagoda	<p>The Thunder Pagoda stands as one of the Four Monarchies of the Netherworld , a powerful faction ruled by the imposing <a href="/characters/2bb9d3d6-3255-4d81-b7c4-64b17b95bbc5" class="Editor_mention__L81up" target="_blank" rel="noopener noreferrer" data-mention-id="2bb9d3d6-3255-4d81-b7c4-64b17b95bbc5" data-mention-class-name="Character">@Huan Ken</a>, King of the <a href="/sites/e071e8d4-49e2-4505-9f69-8673be2826f3" class="Editor_mention__L81up" target="_blank" rel="noopener noreferrer" data-mention-id="e071e8d4-49e2-4505-9f69-8673be2826f3" data-mention-class-name="Site">@The Thunder Pagoda</a>. This massive structure made of shaped clouds serves as both the seat of power and the namesake of Huan Ken's domain.</p><p>At the helm of this formidable faction sits Huan Ken himself - a fearsome Uber-Boss with masterful command of both sorcery and martial arts. His authority is absolute, demonstrated by his willingness to cast disloyal subjects into random Pop-Up Junctures as punishment. Currently, Huan Ken finds himself embroiled in the Monarch War, a conflict with the Darkness Pagoda that began when <a href="/factions/830d358c-789e-4e98-b511-753a0aa8d410" class="Editor_mention__L81up" target="_blank" rel="noopener noreferrer" data-mention-id="830d358c-789e-4e98-b511-753a0aa8d410" data-mention-class-name="Faction">@The Dragons</a> defeated <a href="/characters/41e8e2a1-b6af-49c1-82df-4b1b7b59bfb3" class="Editor_mention__L81up" target="_blank" rel="noopener noreferrer" data-mention-id="41e8e2a1-b6af-49c1-82df-4b1b7b59bfb3" data-mention-class-name="Character">@Ming Yi</a> and delivered her into Huan Ken's custody.</p>	2023-09-03 18:13:35.953579	2025-07-02 20:18:11.430931	0f2b51c0-80c0-4f5f-b55f-76186903df3e	t
0efadcdd-58c6-4844-91a7-2a0527b305a2	The Ascended	<p>The Ascended are a secretive organization whose true nature lies in their origin as transformed animals who have taken human form. At the heart of their conspiracy is a rigid hierarchical structure where those of "animal stock" occupy the highest echelons of power, while fully human members (known as "The Pledged") can never rise beyond certain ranks.</p><p>Their power is derived from carefully controlled feng shui sites, particularly the Fountain of Youth, which grants immortality to their elite members. This supernatural advantage allows them to operate across centuries, manipulating events from the shadows while maintaining their human guises.</p><p>In the modern era (2032), The Ascended have escalated their technological ambitions, developing giant transforming robots like the Onryozinger AB-2, which they've used to attack rival operations such as Manly Company factories. These improbable technological terrors are powered by corrupted feng shui sites and supplemented with technology smuggled from the Cyberpunk Future through portals they control.</p><p>The Ascended maintain legitimate fronts, such as the Golden Horse casino in Macau run by Euston Chau, described as the highest-ranking member of their inner circle known as "the Lodge". They've also infiltrated corporate structures, with at least one known attempt to place an agent as a manager within Manly Company.</p><p>Their ongoing conspiracy appears focused on accumulating power through control of chi-infused sites and advanced technology, while maintaining their secret nature as transformed animals hiding among humanity. They are opposed primarily by a faction known as The Dragons, who work to disrupt their operations and feng shui sites.</p>	2023-07-02 19:31:08.313849	2025-07-20 19:07:33.967313	0f2b51c0-80c0-4f5f-b55f-76186903df3e	t
6bc3abe7-2890-432f-a397-89c763f54d18	The Dragons	<p>The perennial underdogs of the Chi War, constantly rising from humble origins to fight for freedom and justice. Founded by heroes like Kar Fai and the Prof, they recruit everyday heroes, maverick cops, martial artists, and masked avengers who believe in protecting ordinary people. They have a tendency to get wiped out and need constant replacement, but their cause - defending the little guy against overwhelming odds - ensures new generations always answer the call.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
c52de513-622e-4bda-a88e-cec2a5c13ddb	The Guiding Hand	<p>Traditional Chinese monks and martial artists fighting to preserve their civilization against foreign corruption. Founded in 1810 by politically minded monks who foresaw China's decline, they use spiritual wisdom, kung fu mastery, and feng shui knowledge to resist colonial powers and maintain traditional values. Led by Perfect Master Quan Lo, they operate through Golden Candle Societies, combining ancient martial arts with patriotic resistance.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
2f6c737e-44b2-4819-b315-853a809ddb40	The Dragons	<p>The perennial underdogs of the Chi War, constantly rising from humble origins to fight for freedom and justice. Founded by heroes like Kar Fai and the Prof, they recruit everyday heroes, maverick cops, martial artists, and masked avengers who believe in protecting ordinary people. They have a tendency to get wiped out and need constant replacement, but their cause - defending the little guy against overwhelming odds - ensures new generations always answer the call.</p>	2025-08-30 23:25:08.23956	2025-08-30 23:25:08.23956	b35dec35-f3fa-42e6-801a-7a7aeb1b3705	t
9afef0d9-233c-4696-b237-aed0515e0500	The New Simian Army	<p>A militant faction of cyber-enhanced apes led by Furious George, who broke away from the Jammers after the C-Bomb's detonation. Believing that the extinction of humanity was evolution's plan, they see themselves as the rightful inheritors of Earth. Unlike the guilt-ridden Battlechimp Potemkin, Furious George views the C-Bomb as divine providence and leads his simian supremacist army to complete what he sees as natural selection's work.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
8a2a13dc-447f-4e71-98fd-732c8d65be78	The Eaters of the Lotus	<p>Corrupt eunuch sorcerers who have manipulated Chinese imperial courts for millennia. These pale, long-fingernailed court officials use dark magic to accumulate power behind the throne, commanding demons and evil spirits while presenting themselves as loyal servants. They infest periods of weak imperial rule, twisting policy through their intermediary positions between emperors and outside officials, always seeking to expand their supernatural influence.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
50a7bc5c-ca36-48b7-a17b-5698c2e1958e	The Jammers	<p>Anarchist rebels who destroyed the Future juncture by detonating a Chi Bomb to eliminate all magic and free humanity from supernatural control. These scrappy revolutionaries, originally led by cyber-apes Battlechimp Potemkin and Furious George, believed that feng shui sites allowed totalitarian control over people's minds and identities. Though their bomb had catastrophic consequences, they maintain that destroying chi was necessary to preserve free will.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
d12ebf38-6bf4-485d-ab01-36e71e99306a	Grundle's Wasteland Empire	<p>The cyborg warlord General Grundle rules the post-apocalyptic Future through control of fuel, weapons, and technology. From his massive mechanical throne, this grotesquely obese dictator commands road warriors, scavenger gangs, and anyone desperate enough to serve him for gasoline and protection. His empire is built on the ruins of civilization, where survival depends on automotive warfare and allegiance to the only authority left standing in the wasteland.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
c2c5b7cc-0c64-4866-97c1-b1c9b0e8c457	The Thunder Pagoda	<p>The Thunder Monarch leads a twisted religious order that combines demonic power with corrupted divine authority. His followers are fanatical zealots who believe their master is the true voice of heaven, speaking through storms and lightning. Operating from gothic cathedral-fortresses in the Netherworld, they conduct blasphemous ceremonies mixing sacred rituals with supernatural horror. Huan Ken's faction aims to establish a theocracy where his word is divine law, using fear and religious fervor to control both supernatural beings and any mortals they encounter.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
ce40d0a1-ed7c-4122-a219-996e46425115	The Ice Pagoda	<p>The Ice Monarch rules an elegant but merciless court of crystalline beauty and absolute cold. Her followers are aristocratic sorcerers who value perfection, order, and the preservation of power through unchanging hierarchy. From palaces of living ice, they practice subtle manipulation and patient scheming, believing that true power comes from patience and precision rather than brute force. Pi Tui's faction seeks to impose their vision of perfect order on the chaotic world, creating a realm where everything has its proper place and nothing ever changes without their permission.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
f1b59811-a684-4d3f-a07b-4fcafc79eb7d	The Fire Pagoda	<p>The Fire Monarch commands legions of flame-wielding sorcerers and fire elementals across the scorched realms of the Netherworld. His followers worship him as the incarnation of destructive power, believing that only through burning away the old can the new be born. Li Ting's domain features volcanic fortresses and cities of molten glass, where his servants forge weapons from living flame and conduct rituals in rivers of lava. His faction seeks to return to the earthly realm to purify it through cleansing fire, viewing the current world as corrupt and in need of renewal through destruction.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
954edb9f-afd2-4df8-985d-6756594d0d94	The Darkness Pagoda	<p>The Darkness Monarch commands a secretive network of spies, assassins, and occult scholars who operate from hidden temples throughout the Netherworld's darkest corners. Her followers master the arts of stealth, information gathering, and striking from shadows, believing that knowledge and secrecy are the ultimate weapons. They conduct their operations through a web of cults and secret societies, infiltrating other factions and gathering intelligence for their mistress. Ming I's faction aims to control the world through information and fear, ruling from the shadows while others fight openly for power.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
c44f7eaf-425b-497f-b278-92a3bc612e55	Manlysaka	<p>A ruthless techno-corporate empire that promotes cybernetic supremacy through economic manipulation, technological addiction, and systematic discrimination against unenhanced humans. Led by the cyborg executive Ma Yujun, Manlysaka operates on the philosophy that human evolution requires the abandonment of biological weakness in favor of mechanical perfection, using their monopoly on cybernetic technology to create a society where augmentation is both carrot and stick. The corporation maintains control through vertical integration - they manufacture the implants, provide the financing, control the job market that requires them, and own the medical facilities that install them, creating a closed loop where citizens must literally buy their way into the new cybernetic aristocracy or face permanent underclass status. Manlysaka's agents include enhanced corporate security forces, executive cyborgs with neural-linked management capabilities, and street-level enforcers who hunt down "purist" resistance movements, all united by their belief that Ma Yujun's vision of a post-human future represents the next step in evolution rather than the corporate enslavement of the human soul.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
f9c89687-9813-4c50-98fb-ceecfcc5e335	The Ascended	<p>A secret society of transformed animals who have ruled the world from the shadows for centuries. Originally animals who magically became human in ancient times, their descendants now control governments, corporations, and media worldwide. They maintain power by controlling feng shui sites to keep magic suppressed - if magic returns, they risk reverting to their animal forms. Most members are ordinary humans unaware of the conspiracy, but the inner circles (the Pledged and the Lodge) know they serve mysterious masters with inhuman heritage.</p>	2025-08-30 20:46:10.792065	2025-08-30 20:46:10.792065	7b17864e-4e39-41c2-a5b7-6bbbd5aa4ff2	t
a555ba0d-05d5-47cc-a98f-6f4a4154bbd2	The Guiding Hand	<p>Traditional Chinese monks and martial artists fighting to preserve their civilization against foreign corruption. Founded in 1810 by politically minded monks who foresaw China's decline, they use spiritual wisdom, kung fu mastery, and feng shui knowledge to resist colonial powers and maintain traditional values. Led by Perfect Master Quan Lo, they operate through Golden Candle Societies, combining ancient martial arts with patriotic resistance.</p>	2025-08-30 23:25:08.635369	2025-08-30 23:25:08.635369	b35dec35-f3fa-42e6-801a-7a7aeb1b3705	t
