COPY public.junctures (name, description, active, faction_id, created_at, updated_at, notion_page_id, id, campaign_id) FROM stdin;
Modern 2032	<p>The current Modern juncture, created after <a href="/factions/830d358c-789e-4e98-b511-753a0aa8d410" class="Editor_mention__L81up" target="_blank" rel="noopener noreferrer" data-mention-id="830d358c-789e-4e98-b511-753a0aa8d410" data-mention-class-name="Faction">@The Dragons</a> used the Antikythera Mechanism to re-open the portals.</p>	t	\N	2025-07-21 14:29:50.230854	2025-07-21 14:29:50.230854	\N	5c7d5473-9d5a-4539-b38a-39bd1a2393e4	0f2b51c0-80c0-4f5f-b55f-76186903df3e
Cyberpunk Future	<p>The future, year 2377, a cyberpunk dystopia ruled by <a href="/characters/541a3d34-1a05-4e1d-ad9e-31f1785cdeba" class="Editor_mention__L81up" target="_blank" rel="noopener noreferrer" data-mention-id="541a3d34-1a05-4e1d-ad9e-31f1785cdeba" data-mention-class-name="Character">@Ma Yujun 2377</a> as the head of the Manlysaka Corporation.</p>	t	\N	2025-07-21 14:30:53.595539	2025-07-21 14:30:53.595539	\N	27467ab4-d93d-48f5-9c6f-d3e8a951518c	0f2b51c0-80c0-4f5f-b55f-76186903df3e
Past 1870	<p>The current Past Juncture, to a time of kung fu and colonialism.</p>	t	\N	2025-07-21 14:31:17.593865	2025-07-21 14:31:17.593865	\N	ea0ad100-d41a-46ec-8c2c-32b8405b1b10	0f2b51c0-80c0-4f5f-b55f-76186903df3e
Netherworld	<p>The world-between-worlds, connecting the different junctures through portals. Ruled by <a href="/characters/2bb9d3d6-3255-4d81-b7c4-64b17b95bbc5" class="Editor_mention__L81up" target="_blank" rel="noopener noreferrer" data-mention-id="2bb9d3d6-3255-4d81-b7c4-64b17b95bbc5" data-mention-class-name="Character">@Huan Ken</a> and the other Monarchs.</p>	t	\N	2025-07-22 00:57:53.688927	2025-07-22 00:57:53.688927	\N	c1abf823-0cd2-42ac-9f69-952ea0d78c33	0f2b51c0-80c0-4f5f-b55f-76186903df3e
Ancient	<p>Roughly 690 AD, ruled by Wu Zetian of the Tang Dynasty.</p>	t	\N	2025-07-22 00:58:45.226133	2025-07-22 00:58:45.226133	\N	e0c8def0-a590-490d-81d7-401d697ac8d7	0f2b51c0-80c0-4f5f-b55f-76186903df3e
Modern	<p>The original Modern juncture of the campaign, roughly 2022.</p>	t	\N	2025-07-22 01:01:15.436737	2025-07-22 01:01:39.486214	\N	d9524eba-4655-444c-972c-bbc5b26b1dc7	0f2b51c0-80c0-4f5f-b55f-76186903df3e
Future Juncture	<p>The technologically advanced future timeline before the C-Bomb's detonation was a totalitarian state where enhanced apes had overthrown their human creators and established simian supremacy across the globe. Under the New Simian Army's rule, cyber-enhanced gorillas, chimpanzees, and other primates occupy all positions of authority while humans are relegated to second-class status or outright slavery, their former roles as the dominant species reversed through superior technology and organized rebellion. Furious George and his militant followers have built a society that celebrates simian intelligence and physical prowess, using advanced cybernetics and recovered pre-war technology to maintain control over sprawling megacities where propaganda broadcasts remind all citizens that evolution has chosen apes as Earth's rightful inheritors. This oppressive future serves as both the New Simian Army's greatest triumph and their ultimate tragedy - they achieved everything they fought for, only to have it all destroyed when the Jammers' C-Bomb wiped out their perfect world and scattered the survivors across the timelines.</p>	t	1254a2aa-304c-4881-abb1-366c41c1be6b	2025-08-30 23:25:11.11654	2025-08-30 23:25:11.11654	\N	03c81ca0-6850-4603-999a-42a7f67b20c3	b35dec35-f3fa-42e6-801a-7a7aeb1b3705
Ancient Juncture	<p>The golden age of Tang Dynasty China under the iron rule of Empress Wu Zetian represents the height of Chinese imperial power and magical abundance, but the glittering court ceremonies and administrative efficiency mask a sinister reality - pale, long-fingernailed eunuch sorcerers manipulate every policy decision from the shadows of the Forbidden City. While Wu Zetian sits upon the Dragon Throne as China's only female emperor, commanding vast armies and overseeing cultural flowering, the corrupt Eaters of the Lotus pull the true strings of power through their positions as palace intermediaries, using dark magic to summon demons, bind spirits, and twist the empire's abundant chi flow to serve their malevolent purposes. In this juncture where magic flows freely and feng shui sites pulse with visible energy, the eunuchs have created the perfect system - they remain hidden behind screens and curtains while their supernatural servants enforce their will, turning the most prosperous period in Chinese history into a feeding ground for their occult ambitions as they corrupt the Mandate of Heaven itself.</p>	t	f456ddb8-4749-48bc-89f9-04089df6baee	2025-08-30 23:25:11.36343	2025-08-30 23:25:11.36343	\N	df00603c-c5d5-4698-aff9-82472e005aec	b35dec35-f3fa-42e6-801a-7a7aeb1b3705
Past Juncture	<p>The twilight years of Imperial China represent a period of profound crisis where traditional Confucian civilization faces annihilation by foreign colonial powers, but the ancient wisdom of Buddhist monks and Shaolin masters offers the last hope for cultural survival through the secret network known as the Guiding Hand. While British gunships enforce opium trade in Chinese harbors and Western influence corrupts the imperial court, Perfect Master Quan Lo and his followers operate from hidden mountain monasteries and underground Golden Candle Societies, using their mastery of feng shui, martial arts, and traditional philosophy to organize resistance against foreign domination and moral decay. In this juncture where chi flows more freely than in the modern world but less abundantly than in ancient times, the Guiding Hand represents the bridge between spiritual enlightenment and political action - they train peasants in kung fu, teach merchants to resist corruption, and guide government officials toward righteous governance, all while protecting the sacred feng shui sites that maintain China's spiritual integrity against the encroaching darkness of Western materialism and the Lotus eunuchs' supernatural corruption.</p>	t	a555ba0d-05d5-47cc-a98f-6f4a4154bbd2	2025-08-30 23:25:11.519958	2025-08-30 23:25:11.519958	\N	81a56ffe-fd93-44ee-a6be-298f2e8ed1bd	b35dec35-f3fa-42e6-801a-7a7aeb1b3705
Modern Juncture	<p>The Contemporary world appears to be a normal late 20th/early 21st century Earth, but beneath the surface lies a carefully managed reality controlled by the Ascended conspiracy - descendants of transformed animals who have spent centuries positioning themselves in positions of power across every major corporation, government agency, and media outlet. This juncture represents the pinnacle of their control, where magic has been suppressed to near-extinction through their dominance of feng shui sites (disguised as corporate headquarters and cultural landmarks), keeping them safe from reverting to their animal forms while the general population lives in blissful ignorance of the supernatural world, dismissing magic as superstition while unknowingly serving their inhuman rulers who pull the strings from boardrooms and government offices around the globe.</p>	t	10b053ea-f664-4cc7-b12b-2b1133747ef6	2025-08-30 23:25:11.677656	2025-08-30 23:25:11.677656	\N	97e8a49e-70a4-447e-ae49-6a311ddc7b29	b35dec35-f3fa-42e6-801a-7a7aeb1b3705
Future Wasteland	<p>The post-apocalyptic wasteland that remains after the C-Bomb's detonation is a harsh realm where survival depends on gasoline, firepower, and allegiance to the only functioning authority left standing - General Grundle's mechanized empire. From his massive throne built of salvaged technology, the grotesquely obese cyborg warlord controls every drop of fuel, every functioning weapon, and every scrap of useful machinery through a network of road warrior gangs, scavenger crews, and armored convoys that battle across the endless desert highways for resources and territory. In this burned-out future where civilization has collapsed into tribal automotive warfare, Grundle's word is absolute law - those who serve him receive protection and fuel rations, while those who defy him face his armies of weaponized vehicles and cybernetic enforcers in a world where the only remaining currency is violence and the only escape is death.</p>	t	f232b99f-566d-44f8-bfdb-8e930649c6a6	2025-08-30 23:25:11.756275	2025-08-30 23:25:11.756275	\N	91dd2e23-3696-483b-a681-05e0f04396e1	b35dec35-f3fa-42e6-801a-7a7aeb1b3705
Netherworld	<p>The Netherworld is a supernatural realm of impossible architecture and ever-shifting reality where the exiled Four Monarchs hold dominion over vast territories that reflect their elemental natures - Li Ting's volcanic empires of molten glass and eternal flame, Huan Ken's gothic cathedral-fortresses wreathed in perpetual storms, Pi Tui's crystalline palaces where time moves like frozen honey, and Ming Yi's shadow-cities that exist in the spaces between light and darkness. This dimension serves as both prison and kingdom for the siblings who once ruled the entire world, its malleable laws of physics allowing them to reshape reality according to their will while trapping them away from the mortal realm they desperately wish to reclaim. Here, demons and spirits serve as courtiers, the landscape responds to the Monarchs' emotions, and the boundaries between different domains shift like the tide - yet for all their godlike power within this realm, the Four Monarchs remain fundamentally exiles, their magnificent courts and elemental armies serving as constant reminders of the earthly empire they lost and the cosmic revenge they still plot against the world that banished them.</p>	t	\N	2025-08-30 23:25:12.07657	2025-08-30 23:25:12.07657	\N	388e17ef-b5f4-4173-bbb7-a19b6182316a	b35dec35-f3fa-42e6-801a-7a7aeb1b3705
Cyberpunk Future	<p>The gleaming neon-soaked megacities of the near future are dominated by the Manlysaka Corporation, a techno-industrial empire run by the cyborg executive Ma Yujun who has systematically elevated cybernetic enhancement from luxury to necessity while positioning "pure" humans as an obsolete underclass. Under Manlysaka's corporate hegemony, employment, housing, medical care, and even basic civil rights are tied to one's degree of cybernetic modification - the more machine parts you possess, the higher your social status and access to resources, while unenhanced humans are relegated to sprawling slums beneath the chrome towers where cyborg elites conduct business at the speed of thought through neural networks. Ma Yujun's vision of transhumanist evolution has created a society where the boundary between flesh and machine has been deliberately blurred through corporate policy, addictive technology, and economic coercion, turning the entire population into either willing converts to his cybernetic faith or desperate refugees hiding from mandatory "upgrades" in a world where being fully human has become both a political statement and a death sentence.</p>	t	ecb16577-6e76-4bdf-9952-ad5f3d99170e	2025-08-30 23:25:12.554395	2025-08-30 23:25:12.554395	\N	0d765ce7-5682-484a-b4a0-255e571026ca	b35dec35-f3fa-42e6-801a-7a7aeb1b3705
