72f84df7-6dfc-42f3-8d55-dba8e40d3190	<p>The Immortal Woman is a ghostly vessel infused with soul-energy, its eerie glow cutting through the Netherworld void as it prepares for its christening. Its structure is otherworldly, with glowing planks and ceremonial banners adorning the Main Deck, a broad expanse set for dynamic combat. Below, the Soul Engine Room pulses with a crystal core, its narrow catwalks testing agility amidst swirling power. The Crow’s Nest, a swaying perch topped with a lightning rod, offers a high vantage for strategy, while the Captain’s Bridge features a rune-covered helm, inviting disruption of its command. The Rigging and Sails, with energy-pulsing ropes, provide a vertical battlefield for daring moves.</p>	2025-06-25 12:45:10.014325	2025-06-28 12:42:24.259717	0f2b51c0-80c0-4f5f-b55f-76186903df3e	Immortal Woman	d9bc6c2f-ebe1-4300-a836-dcb36e6454ab	\N	t
