5554689b-5832-41ca-a603-0bcfa0151f65	<p>Atlantis is an undersea kingdom, accessible only through a magical gate in the ocean's floor. The gate can be moved to a new location by Atlantis' rulers, to avoid discovery.</p><p>The King of Atlantis called upon <a href="/factions/830d358c-789e-4e98-b511-753a0aa8d410" class="mention" target="_blank" rel="noopener noreferrer" data-mention-id="830d358c-789e-4e98-b511-753a0aa8d410" data-mention-class-name="Faction">@The Dragons</a> to help when forces of the Thunder Pagoda threatened them. A battle ensued, with The Dragons facing Lucius Centares and the giant sea monster Tarothiarian.</p><p>The Dragons won, and gained access to the Antikythera Mechanism, a magical artifact which they used to reopen the portals to the Netherworld, which had been closed.</p>	2023-09-14 14:28:38.423923	2025-06-30 13:11:36.822371	0f2b51c0-80c0-4f5f-b55f-76186903df3e	Atlantis	\N	\N	t
642c8871-a24b-4508-9bb8-ac9e1b6ce2b6	<p>The Dragons were granted access to the Chicago Water Tower feng shui site in Chicago 1850 after aiding the city and defeating <a href="/characters/c1691f06-26e8-485e-a537-b661eae30d1e" class="mention" target="_blank" rel="noopener noreferrer" data-mention-id="c1691f06-26e8-485e-a537-b661eae30d1e" data-mention-class-name="Character">@Caesar King</a>'s attempts to trigger the Chicago Fire a year early.</p>	2023-07-01 20:58:35.457827	2025-06-30 13:24:11.737184	0f2b51c0-80c0-4f5f-b55f-76186903df3e	Chicago Water Tower	0efadcdd-58c6-4844-91a7-2a0527b305a2	\N	t
